import React from 'react';
import { useSelector } from 'react-redux';
import PortfolioFooter from './PortfolioFooter';

const UserPortfolioView = () => {
  const portfolioData = useSelector((state) => state.userPortfolio.data);

  if (!portfolioData) {
    return <div>Loading...</div>; // or some loading spinner
  }

  // Convert the portfolioData object to a JSON string and format it with indentation
  const prettyData = JSON.stringify(portfolioData, null, 2);

  return (
    <div className="portfolio-view">
      {/* Render the JSON string in a preformatted block */}
      <pre>{prettyData}</pre>
      <PortfolioFooter />
    </div>
  );
};

export default UserPortfolioView;
